// App.js
import React from 'react';
import Header from './components/Header.js'; // Make sure to import your Header component
import './App.css'; // Import your main CSS file

import homeImage from './images/home.jpg'; // Import your image

const App = () => {
  return (
    <div className="app">
      <Header />
      <main className="main-content">
        <div className="image-container">
          <img className="home-image" src={homeImage} alt="Home" />
        </div>
        <div className="color-block">
          <h2>My Recent Projects</h2>
          <p>This is a description of my recent projects.</p>
        </div>
      </main>
    </div>
  );
};

export default App;
